import React, { Component } from 'react';

import Head from 'next/head';

class DetailTeam extends Component {

    constructor(props) {
        super(props);
        this.state = {
            detailTeamObj: ''
        }
    }
    UNSAFE_componentWillMount() {
        this.setDetailTeamObj();
    }

    setDetailTeamObj = () => {
        this.setState({ detailTeamObj: this.props.detailTeamObj.url.query });
    }

    getDetailTeamObj = () => {
        if (this.state.detailTeamObj) {
            let data = this.state.detailTeamObj;
            console.log("data", data);
            return (
                <div className="team-detail">
                    <div className="container">
                        <div className="img-user">
                            <img src={data.image} alt="Justin Harper" />
                            <a className="back"><img src={data.backArrow} alt="Image description" /> See All Leadership</a>
                        </div>
                        <div className="textblock">
                            <div className="holder">
                                <h2>{data.name}</h2>
                                <span className="designation">{data.designation}</span>
                                {/* <p>Jazmene began working in Aesthetics in 2017 as a Patient Coordinator for an Ohio-based Plastic Surgeon. She fell in love with the industry, and joined Aesthetic Record with first-hand experience on the potential pitfalls and practice benefits that come from using an EMR system. Jazmene understands the changing dynamics of a busy practice, and she takes pride in providing a very genuine customer service experience, ensuring each client receives outstanding support. Her passion to connect with AR Users on a very relatable level and to guide each one through an impactful training journey. When Jazmene isn't busy doing her most important job as a mother to two great kids, she enjoys attending music festivals & traveling.</p> */}
                                {/* <div dangerouslySetInnerHTML={{__html: {listItems}}} /> */}
                            </div>
                        </div>
                    </div>
                </div>
            )
        }
    }

    render() {
        return (
            <div>
                <Head>
                    <link href="https://fonts.googleapis.com/css?family=Montserrat:300,400,500,600,700&display=swap" rel="stylesheet" />
                    <link href="/static/style.css" rel="stylesheet" />
                </Head>
                <main className="main">
                    <ul className="breadcrumbs container">
                        <li><a >Home</a></li>
                        <li className="current"><a >Elevate by Aesthetic Record</a></li>
                    </ul>
                    {this.getDetailTeamObj()}
                </main>
            </div>
        );
    }
}

export default DetailTeam;
